// JournalPage.js
import React from 'react';
import './JournalPage.css';

const JournalPage = ({ title, content, image }) => {
  return (
    <div className="journal-page">
      <h2>{title}</h2>
      <p>{content}</p>
      <div className="postcard"><img src={image} alt="Postcard" className="postcard-image" /></div>
    </div>
  );
};

export default JournalPage;
